pragma solidity ^0.5.0;

contract collegeRating{

  struct ratingStruct{
          uint[] deptId;
          mapping(uint => uint) rating;
          uint avgRating;

        }  

  mapping (address => ratingStruct) collageRating;

  // event declearation 
  // event are used to 
   event enterRating(address collageAddress,uint dId, uint _rating);

  function setRating(address _collegeAddress, uint _deptId, uint _rating)
     public {

       collageRating[_collegeAddress].deptId.push(_deptId);
       collageRating[_collegeAddress].rating[_deptId] = _rating;

       emit enterRating(_collegeAddress, _deptId, _rating );

     }


    function getDeptRating(address _collegeAddress, uint _deptId)
     public view returns(uint){
     return collageRating[_collegeAddress].rating[_deptId] ;

     }

     function getCollageRating(address _collegeAddress ) public view returns(uint , uint)
     {
       uint length ; uint  temp ;
       uint collRating = 0;

       length = collageRating[_collegeAddress].deptId.length ;


       for (uint i = 0 ; i < length ; i++){
            temp =  collageRating[_collegeAddress].deptId[i];
            collRating = collageRating[_collegeAddress].rating[temp] + collRating ;

       }

      // result = "Number of college are  "  length  ;
        collRating = collRating / length ;
       return   ( length , collRating ) ;

     }

}
